E_D("replace into `phome_ecms_game` values('1225','5','1','','','','1','admin','|41|','1','0','1343190564','0','0','0','0','','','1225','0','0','0','0','0','0','葫芦娃高清DVD版','1343190564','/spic/20120725/1432.jpg','0','1','1343971297','0','3','1','0','','1','','','667','479','传说葫芦山里关着蝎子精和蛇精。一只穿山甲不小心打穿了山洞，两个妖精逃了出来，从此百姓遭难。穿山甲急忙去告诉一个老汉，只有种出七色葫芦，才能消灭这两个妖精。老汉种出了红、橙、黄、绿、青、蓝、紫七个大葫芦，却被妖精从如意镜中窥见 。他们摧毁不了这七个葫芦，就把老汉和穿山甲抓去。七个葫芦成熟了， 相继落地变成七个男孩，穿着七种颜色的服装。他们为了消灭妖精，救出老汉和穿山甲，一个接一个去与妖精搏斗。红娃是大力士，但有勇无谋， 落入蜘蛛网被擒。橙娃是千里眼和顺风耳，却被妖精的魔镜射瞎了眼睛 。黄娃是硬铁头，由于寡不敌众，被妖精用磁石吸住。绿娃会火功，又被妖镜的寒光变成冰人。青娃有水性，被妖精用罂粟花醉倒。蓝娃有隐身术 ，去偷妖精的如意，解救了前五个兄弟。但是紫娃已被妖精挑拨离间，结果紫娃把妖精吸进自己的宝葫芦，也被他们活捉。妖精把七兄弟送进炼丹炉，想炼成七心丹。这时，他们联合起来，发挥各人的法术，冲出炼丹炉，终于打败妖精，把他们收进宝葫芦里。','1','','0','','1','/dpic/20120725/1433.jpg','217','/donghuapian/217/1.html, /donghuapian/217/2.html, /donghuapian/217/3.html, /donghuapian/217/4.html, /donghuapian/217/5.html, /donghuapian/217/6.html, /donghuapian/217/7.html, /donghuapian/217/8.html, /donghuapian/217/9.html, /donghuapian/217/10.html, /donghuapian/217/11.html, /donghuapian/217/12.html, /donghuapian/217/13.html,','1','0','','http://www.61baobao.com/donghuapian/dpic/06/034.jpg','http://www.61baobao.com/donghuapian/pic/06/034.jpg','0','三个月以上','13','sina,2513023|||sina,5874132|||sina,5875379|||sina,5876062|||sina,5876631|||sina,7878881|||sina,7879340|||sina,7879787|||sina,7880103|||sina,7880624|||sina,7881023|||sina,7881359|||sina,15424574|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1226','5','0','','','','1','admin','','1','0','1343190565','0','0','0','0','','','1226','0','0','0','0','0','0','羊羊运动会','1343190565','/spic/20120725/1484.jpg','0','1','1343190565','0','3','1','0','','0','','','667','479','羊族运动会将要在青青草原上举办。为选拔出圣火传递手，羊村进行了别出新意的比赛。一心想要成为传递手的村长在暗中作手脚，不想却遭到灰太狼屡屡破坏。众小羊得知一切后，...<br />','1','','0','','1','/dpic/20120725/1485.jpg','67','/donghuapian/67/1.html, /donghuapian/67/2.html, /donghuapian/67/3.html, /donghuapian/67/4.html, /donghuapian/67/5.html, /donghuapian/67/6.html, /donghuapian/67/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/58.jpg','http://www.61baobao.com/donghuapian/pic/58.jpg','0','三个月以上','7','qiyi,15c8f274fe8511dfaa6aa4badb2c35a1|||qiyi,15c8f9a4fe8511dfaa6aa4badb2c35a1|||qiyi,15c9048afe8511dfaa6aa4badb2c35a1|||qiyi,15c90af2fe8511dfaa6aa4badb2c35a1|||qiyi,15e9cd64fe8511dfaa6aa4badb2c35a1|||qiyi,15c9318afe8511dfaa6aa4badb2c35a1|||qiyi,15c9364efe8511dfaa6aa4badb2c35a1|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1227','5','0','','','','1','admin','','1','0','1343190568','0','0','0','0','','','1227','0','0','0','0','0','0','奇思妙想喜羊羊','1343190568','/spic/20120725/1490.jpg','0','1','1343190568','0','3','1','0','','0','','','667','479','    在全新的《奇思妙想喜羊羊》 系列中，将延续以往轻松、搞笑、寓教于乐的风格，并在此基础上加入冒险、亲子、科幻等元素，再度把小朋友们带入奇趣的动画世界。在全新的系列中，小羊们将会跟各种交通工具成为好朋友，一起对抗邪恶的灰太狼。可是灰太狼仍是那么的阴险狡猾，骗取了交通工具的信任，并利用他们去抓羊。可是小羊们凭着勇气、智慧、团结、友谊，一次又一次地识穿了灰太狼的抓羊诡计。与此同时，天真可爱的小灰灰跟大多数的小朋友一样，开始认识这个快乐的世界，在学习的过程中，他总是有各种各样奇怪的问题，特别的想法，让一向自以为绝顶聪明的家长——灰太狼也穷于应付。为了让小灰灰走上“正”途，灰太狼出尽法宝，一心想让小灰灰出“狼”头地。可是小灰灰却在玩乐中与小羊们建立起深厚的感情。有爸爸和朋友们的悉心照顾，小灰灰的学习生活充满了欢乐和刺激。','1','','0','','1','/dpic/20120725/1491.jpg','266','/donghuapian/266/1.html, /donghuapian/266/2.html, /donghuapian/266/3.html, /donghuapian/266/4.html, /donghuapian/266/5.html, /donghuapian/266/6.html, /donghuapian/266/7.html, /donghuapian/266/8.html, /donghuapian/266/9.html, /donghuapian/266/10.html, /donghuapian/266/11.html, /donghuapian/266/12.html, /donghuapian/266/13.html, /donghuapian/266/14.html, /donghuapian/266/15.html, /donghuapian/266/16.html, /donghuapian/266/17.html, /donghuapian/266/18.html, /donghuapian/266/19.html, /donghuapian/266/20.html, /donghuapian/266/21.html, /donghuapian/266/22.html, /donghuapian/266/23.html, /donghuapian/266/24.html, /donghuapian/266/25.html, /donghuapian/266/26.html, /donghuapian/266/27.html, /donghuapian/266/28.html, /donghuapian/266/29.html, /donghuapian/266/30.html, /donghuapian/266/31.html, /donghuapian/266/32.html, /donghuapian/266/33.html, /donghuapian/266/34.html, /donghuapian/266/35.html, /donghuapian/266/36.html, /donghuapian/266/37.html, /donghuapian/266/38.html, /donghuapian/266/39.html, /donghuapian/266/40.html, /donghuapian/266/41.html, /donghuapian/266/42.html, /donghuapian/266/43.html, /donghuapian/266/44.html, /donghuapian/266/45.html, /donghuapian/266/46.html, /donghuapian/266/47.html, /donghuapian/266/48.html, /donghuapian/266/49.html, /donghuapian/266/50.html, /donghuapian/266/51.html,