E_D("replace into `phome_ecms_game` values('1251','5','1','','','','1','admin','','1','0','1343190657','0','0','0','0','','','1251','0','0','0','0','0','0','蓝巨星和绿豆鲨','1343190657','/spic/20120725/1488.jpg','0','1','1343190657','0','3','1','0','','0','','','667','479','《蓝巨星和绿豆鲨》是以海洋为背景的童话故事,故事发生在奇妙的海洋世界，和平美丽的珊瑚村里，住着一群幸福乐观的鱼类居民。珊瑚村的村长是村里年龄最大的龟博士，虽已千岁但却是一个不谙世事的老顽童。他掌握珊瑚村所有的历史掌故，喜欢研究发明各类稀奇古怪的东西，但总是在关键时候不好使。善良单纯的小蓝鲸是个十岁的小男孩，珊瑚村的孩子头，好奇心旺盛、鬼点子多、偶有自作聪明的表现！每当危急时刻，他都会吃一种健康的海洋食品海苔，变身为“蓝巨星”打败敌人解决危机。这个蓝巨星就是我们的主人公。他为什么会来到珊瑚村，他的父母是谁？','1','','0','','1','/dpic/20120725/1489.jpg','243','/donghuapian/243/1.html, /donghuapian/243/2.html, /donghuapian/243/3.html, /donghuapian/243/4.html, /donghuapian/243/5.html, /donghuapian/243/6.html, /donghuapian/243/7.html, /donghuapian/243/8.html, /donghuapian/243/9.html, /donghuapian/243/10.html, /donghuapian/243/11.html, /donghuapian/243/12.html, /donghuapian/243/13.html, /donghuapian/243/14.html, /donghuapian/243/15.html, /donghuapian/243/16.html, /donghuapian/243/17.html, /donghuapian/243/18.html, /donghuapian/243/19.html, /donghuapian/243/20.html, /donghuapian/243/21.html, /donghuapian/243/22.html, /donghuapian/243/23.html, /donghuapian/243/24.html, /donghuapian/243/25.html, /donghuapian/243/26.html, /donghuapian/243/27.html, /donghuapian/243/28.html, /donghuapian/243/29.html, /donghuapian/243/30.html, /donghuapian/243/31.html, /donghuapian/243/32.html, /donghuapian/243/33.html, /donghuapian/243/34.html, /donghuapian/243/35.html, /donghuapian/243/36.html, /donghuapian/243/37.html, /donghuapian/243/38.html, /donghuapian/243/39.html, /donghuapian/243/40.html, /donghuapian/243/41.html, /donghuapian/243/42.html, /donghuapian/243/43.html, /donghuapian/243/44.html, /donghuapian/243/45.html, /donghuapian/243/46.html, /donghuapian/243/47.html, /donghuapian/243/48.html, /donghuapian/243/49.html, /donghuapian/243/50.html, /donghuapian/243/51.html, /donghuapian/243/52.html, /donghuapian/243/53.html, /donghuapian/243/54.html, /donghuapian/243/55.html, /do